var violationPricing;(function(){violationPricing=new Vue({el:"#event-violation-pricing",components:{},mounted:function(){var n=this;ajaxService("GET",objEvent.GetPricing,null,function(t){n.eventPricing=t.data})},data:{violations:objEvent.violations,eventPricing:[],violationId:"",fee:null,isUpdate:!1},computed:{},methods:{CreatePrice:function(){var n=this,i=_.find(objEvent.violations,function(t){return t.Id===n.violationId}),t;blockUI();t={EventId:objEvent.EventId,ViolationId:n.violationId,Fee:n.fee};ajaxService("POST",objEvent.AddPricing,JSON.stringify(t),function(t){t.data.violation={name:i.Name};n.eventPricing.push(t.data);n.violationId=null;n.fee=null;demo.showNotification("success","Price added.");unblockUI()},function(){unblockUI()})},RemovePrice:function(n){var t=this,i=objEvent.DeletePricing+"/"+n;blockUI();ajaxService("GET",i,null,function(){demo.showNotification("success","Price deleted.");var i=_.findIndex(t.eventPricing,function(t){return t.id==n});t.eventPricing.splice(i,1);unblockUI()})}}})})(jQuery);